import React from 'react';

import LandingButton from './../../components/LandingButton.js'
import Header from './../../components/Header.js'

import './Landing.css';

function Landing() {
  return (
      <div class="landing">
            <div class="text-container">
                <p>STAT 198</p>
                <p>Introduction to Poker</p>

                <b>Schedule</b>
                <p>Lectures</p>

            </div>
      </div>
  );
}

export default Landing;
